import React, { Fragment } from 'react';
import './App.css';

// components
import Survey from './Components/survey'
import BarByCompany from './Components/BarByCompany';
import ScatterByCompany from './Components/ScatterByCompany';

function App() {
  return (
    <Fragment>
      <div className="container">
        <Survey/>
        <BarByCompany/>
        <ScatterByCompany/>
      </div>
    </Fragment>
  );
};

export default App;
